import React from 'react';

import {
    CartItemContainer,
    ImageContainer
} from './cart-item.styles';


const CartItem = ({ item: { imageUrl, price, name, quantity } }) => (
    <CartItemContainer>
        <img
            className='img'
            src={imageUrl}
            alt='item'
        />
        <div className='item-details'>
            <span className='name'>{name}</span>
            <span className='price'>
                {quantity} x ${price}
            </span>
        </div>
    </CartItemContainer>
);

export default CartItem;
